INSERT INTO `hadith` VALUES (1,'عَنْ أُمِّ سَلَمَةَ، زَوْجَ النَّبِيِّ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ، رَضِيَ الله عَنْهَا قَالَتْ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"مَنْ كَانَ لَهُ ذِبْحٌ يَذْبَحُهُ فَإِذَا أُهِلَّ هِلَالُ ذِي الْحِجَّةِ فَلَا يَأْخُذَنَّ مِنْ شَعْرِهِ وَلَا مِنْ أَظْفَارِهِ شَيْئًا حَتَّى يُضَحِّيَ\"',NULL,NULL),(2,'‏عَنْ ‏عَبْدِ اللَّهِ بْنِ مَسْعُودٍ ‏قَالَ: قَالَ رَسُولُ اللَّهِ ‏صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"مَنْ نَزَلَتْ بِهِ فَاقَةٌ ‏فَأَنْزَلَهَا بِالنَّاسِ ‏لَمْ تُسَدَّ ‏فَاقَتُهُ ‏وَمَنْ نَزَلَتْ بِهِ ‏فَاقَةٌ ‏فَأَنْزَلَهَا بِاللَّهِ ‏فَيُوشِكُ اللَّهُ لَهُ بِرِزْقٍ عَاجِلٍ أَوْ آجِلٍ\"',NULL,NULL),(3,'عَنْ أَبِي قَتَادَةَ رَضِيَ الله عَنْهُ قَالَ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"صِيَامُ يَوْمِ عَرَفَةَ أَحْتَسِبُ عَلَى اللَّهِ أَنْ يُكَفِّرَ السَّنَةَ الَّتِي قَبْلَهُ وَالسَّنَةَ الَّتِي بَعْدَهُ\". وعَنْ زَيْدِ بْنِ خَالِدٍ الْجُهَنِيِّ رَضِيَ الله عَنْهُ قَالَ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"مَنْ فَطَّرَ صَائِمًا كَانَ لَهُ مِثْلُ أَجْرِهِ غَيْرَ أَنَّهُ لَا يَنْقُصُ مِنْ أَجْرِ الصَّائِمِ شَيْئًا\"',NULL,NULL),(4,'عَنْ عُقْبَةَ بْنِ عَامِرٍ رَضِيَ اللَّهُ عَنْهُ، عَنِ النَّبِيِّ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ قَالَ: \"إِذَا رَأَيْتَ اللَّهَ تَعَالى يُعْطِي الْعَبْدَ مِنَ الدُّنْيَا مَا يُحِبُّ وَهُوَ مُقِيمٌ عَلَى مَعَاصِيهِ فَإِنَّمَا ذَلِكَ مِنْهُ اسْتِدْرَاجٌ\"، ثُمَّ تَلَا رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: {فَلَمَّا نَسُوا مَا ذُكِّرُوا بِهِ فَتَحْنَا عَلَيْهِمْ أَبْوَابَ كُلِّ شَيْءٍ حَتَّى إِذَا فَرِحُوا بِمَا أُوتُوا أَخَذْنَاهُمْ بَغْتَةً فَإِذَا هُمْ مُبْلِسُونَ}',NULL,NULL),(5,'عَنْ مُعَاذِ بْنِ أَنَسٍ الْجُهَنِيِّ رَضِيَ الله عَنْهُ، عَنِ النَّبِيِّ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ قَالَ: \"مَنْ أَكَلَ طَعَامًا فَقَالَ الْحَمْدُ لِلَّهِ الَّذِي أَطْعَمَنِي هَذَا وَرَزَقَنِيهِ مِنْ غَيْرِ حَوْلٍ مِنِّي وَلَا قُوَّةٍ غُفِرَ لَهُ مَا تَقَدَّمَ مِنْ ذَنْبِهِ\"',NULL,NULL),(6,'عَنْ أَبِي هُرَيْرَةَ أَنَّ رَسُولَ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ  قَالَ: \"مَنْ كَانَتْ عِنْدَهُ مَظْلِمَةٌ لِأَخِيهِ فَلْيَتَحَلَّلْهُ مِنْهَا فَإِنَّهُ لَيْسَ ثَمَّ دِينَارٌ وَلَا دِرْهَمٌ مِنْ قَبْلِ أَنْ يُؤْخَذَ لِأَخِيهِ مِنْ حَسَنَاتِهِ فَإِنْ لَمْ يَكُنْ لَهُ حَسَنَاتٌ أُخِذَ مِنْ سَيِّئَاتِ أَخِيهِ فَطُرِحَتْ عَلَيْهِ\"',NULL,NULL),(7,'عَنْ أَنَسِ بْنِ مَالِكٍ رَضِيَ الله عَنْهُ، عَنْ رَسُولِ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ أَنَّهُ قَالَ: \"عِظَمُ الْجَزَاءِ مَعَ عِظَمِ الْبَلَاءِ وَإِنَّ اللَّهَ إِذَا أَحَبَّ قَوْمًا ابْتَلَاهُمْ فَمَنْ رَضِيَ فَلَهُ الرِّضَا وَمَنْ سَخِطَ فَلَهُ السُّخْطُ\"',NULL,NULL),(8,'عَنْ جَابِرِ بْنِ عَبْدِ اللهِ وَابْنِ عَبَّاسٍ رَضِيَ اللهُ عَنْهُمَا، قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"أَدِيمُوا الْحَجَّ وَالْعُمْرَةَ، فَإِنَّهُمَا يَنْفِيَانِ الْفَقْرَ وَالذُّنُوبَ كَمَا يَنْفِي الْكِيرُ خَبَثَ الْحَدِيدِ\"',NULL,NULL),(20,'عَنْ أَبِي هُرَيْرَةَ رَضِيَ اللهُ عَنْهُ، قَالَ: أَلا أُخْبِرُكُمْ بِأَسْرَعَ كَرَّةً وَأَعْظَمَ غَنِيمَةً مِنْ هَذَا الْبَعْثِ؟ رَجُلٌ تَوَضَّأَ فِي بَيْتِهِ فَأَحْسَنَ وُضُوءَهُ، ثُمَّ تَحَمَّلَ إِلَى الْمَسْجِدِ، فَصَلَّى فِيهِ الْغَدَاةَ، ثُمَّ عَقَّبَ بِصَلاةِ الضُّحَى، فَقَدْ أَسْرَعَ الْكَرَّةَ، وَأَعْظَمَ الْغَنِيمَةَ',NULL,NULL),(9,'عَنْ عَبْدِ اللهِ بْنِ عُمَرَ رَضِيَ الله عَنْهُمَا، قَالَ رَسُولُ اللَّهِ صَلَّى الله عَلَيْهِ وَسَلَّمَ: \"إِذَا سَبَّكَ رَجُلٌ بِمَا يَعْلَمُ مِنْكَ فَلَا تَسُبَّهُ بِمَا تَعْلَمُ مِنْهُ فَيَكُونَ أَجْرُ ذَلِكَ لَكَ وَوَبَالُهُ عَلَيْهِ\"',NULL,NULL),(10,'عَنْ أَبِي هُرَيْرَةَ رَضِيَ الله عَنْهُ قَالَ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"أَفْضَلُ الصِّيَامِ بَعْدَ شَهْرِ رَمَضَانَ شَهْرُ اللَّهِ الْمُحَرَّمُ وَأَفْضَلُ الصَّلَاةِ بَعْدَ الْفَرِيضَةِ صَلَاةُ اللَّيْلِ\"',NULL,NULL),(11,'عَنْ عَبْدِ اللهِ بْنِ عُمَرَ رَضِيَ الله عَنْهُمَا، قَالَ رَسُولُ اللَّهِ صَلَّى الله عَلَيْهِ وَسَلَّمَ: \"إِذَا سَبَّكَ رَجُلٌ بِمَا يَعْلَمُ مِنْكَ فَلَا تَسُبَّهُ بِمَا تَعْلَمُ مِنْهُ فَيَكُونَ أَجْرُ ذَلِكَ لَكَ وَوَبَالُهُ عَلَيْهِ\"',NULL,NULL),(12,'عَنْ عَبْدِ اللهِ بْنِ أَبِي قَتَادَةَ رَضِيَ الله عَنْهُ قَالَ: دَخَلَ عَلَيَّ أَبُو قَتَادَةَ وَأَنَا أَغْتَسِلُ يَوْمَ الْجُمُعَةِ فَقَالَ: أَغُسْلُكَ هَذَا مِنْ جَنَابَةٍ؟ قُلْتُ: نَعَمْ، قَالَ: أَعِدْ غُسْلًا آخَرَ فَإِنِّي سَمِعْتُ النَّبِيَّ صَلَّى الله عَلَيْهِ وَسَلَّمَ يَقُولُ: \"مَنِ اغْتَسَلَ يَوْمَ الجُمُعَةِ لَمْ يَزَلْ طَاهِرًا إِلَى الجُمُعَةِ الأُخْرَى\"',4,NULL),(13,'عَنْ عَبْدِ اللهِ بْنِ عُمَرَ بْنِ الْخَطَّابِ رَضِيَ اللَّهُ عَنْهُمَا عَنْ أَبِيهِ قَالَ: قَالَ رَسُولُ اللَّهِ ‏ ‏صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"‏‏مَنْ قَالَ حِينَ يَدْخُلُ السُّوقَ: لَا إِلَهَ إِلَّا اللَّهُ وَحْدَهُ لَا شَرِيكَ لَهُ لَهُ الْمُلْكُ وَلَهُ الْحَمْدُ يُحْيِي وَيُمِيتُ وَهُوَ حَيٌّ لَا يَمُوتُ بِيَدِهِ الْخَيْرُ كُلُّهُ وَهُوَ عَلَى كُلِّ شَيْءٍ قَدِيرٌ كَتَبَ اللَّهُ لَهُ أَلْفَ أَلْفِ حَسَنَةٍ وَمَحَا عَنْهُ أَلْفَ أَلْفِ سَيِّئَةٍ وَبَنَى لَهُ بَيْتًا فِي الْجَنَّةِ\"',NULL,NULL),(14,'‏عَنْ أَبِي قَتَادَةَ رَضِيَ الله عَنْهُ قَالَ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"صِيَامُ يَوْمِ عَرَفَةَ أَحْتَسِبُ عَلَى اللَّهِ أَنْ يُكَفِّرَ السَّنَةَ الَّتِي قَبْلَهُ وَالسَّنَةَ الَّتِي بَعْدَهُ\". وعَنْ زَيْدِ بْنِ خَالِدٍ الْجُهَنِيِّ رَضِيَ الله عَنْهُ قَالَ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"مَنْ فَطَّرَ صَائِمًا كَانَ لَهُ مِثْلُ أَجْرِهِ غَيْرَ أَنَّهُ لَا يَنْقُصُ مِنْ أَجْرِ الصَّائِمِ شَيْئًا\"',NULL,NULL),(15,'عن عُبَادَةَ بْن الصَّامِتِ قَالَ: أَشْهَدُ أَنِّي سَمِعْتُ رَسُولَ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ  يَقُولُ: \"خَمْسُ صَلَوَاتٍ افْتَرَضَهُنَّ اللَّهُ تَعَالَى مَنْ أَحْسَنَ وُضُوءَهُنَّ وَصَلَّاهُنَّ لِوَقْتِهِنَّ وَأَتَمَّ رُكُوعَهُنَّ وَخُشُوعَهُنَّ كَانَ لَهُ عَلَى اللَّهِ عَهْدٌ أَنْ يَغْفِرَ لَهُ وَمَنْ لَمْ يَفْعَلْ فَلَيْسَ لَهُ عَلَى اللَّهِ عَهْدٌ إِنْ شَاءَ غَفَرَ لَهُ وَإِنْ شَاءَ عَذَّبَهُ\"',NULL,NULL),(16,'عَنْ أَبِي سَعِيدٍ وَأَبِي هُرَيْرَةَ رضي الله عنهما، عَنْ النَّبِيِّ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ قَالَ: \"إِذَا اسْتَيْقَظَ الرَّجُلُ مِنْ اللَّيْلِ وَأَيْقَظَ أَهْلَهُ وَصَلَّيَا رَكْعَتَيْنِ، كُتِبَا مِنْ الذَّاكِرِينَ اللَّهَ كَثِيرًا وَالذَّاكِرَاتِ\"',NULL,NULL),(17,'عَنْ أَنَسِ بْنِ مَالِكٍ رَضِيَ اللَّهُ عَنْهُ قَالَ: قَالَ رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"مَنْ صَلَّى لِلَّهِ أَرْبَعِينَ يَوْمًا فِي جَمَاعَةٍ يُدْرِكُ التَّكْبِيرَةَ الْأُولَى كُتِبَتْ لَهُ بَرَاءَتَانِ بَرَاءَةٌ مِنْ النَّارِ وَبَرَاءَةٌ مِنْ النِّفَاقِ\"',NULL,NULL),(18,'عَنْ عَبْدِ اللَّهِ بْنِ عَامِرٍ رَضِيَ الله عَنْهُ أَنَّهُ قَالَ دَعَتْنِي أُمِّي يَوْمًا وَرَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ قَاعِدٌ فِي بَيْتِنَا فَقَالَتْ: هَا تَعَالَ أُعْطِيكَ، فَقَالَ لَهَا رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"وَمَا أَرَدْتِ أَنْ تُعْطِيهِ؟\" قَالَتْ: أُعْطِيهِ تَمْرًا، فَقَالَ لَهَا رَسُولُ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ: \"أَمَا إِنَّكِ لَوْ لَمْ تُعْطِهِ شَيْئًا كُتِبَتْ عَلَيْكِ كِذْبَةٌ\"',NULL,NULL),(19,'عَنْ أَنَسِ بْنِ مَالِكٍ رَضِيَ الله عَنْهُ قَالَ: سَمِعْتُ رَسُولَ اللَّهِ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ يَقُولُ: \"وَالَّذِي نَفْسِي بِيَدِهِ أَوْ قَالَ وَالَّذِي نَفْسُ مُحَمَّدٍ بِيَدِهِ لَوْ أَخْطَأْتُمْ حَتَّى تَمْلَأَ خَطَايَاكُمْ مَا بَيْنَ السَّمَاءِ وَالْأَرْضِ ثُمَّ اسْتَغْفَرْتُمْ اللَّهَ عَزَّ وَجَلَّ لَغَفَرَ لَكُمْ وَالَّذِي نَفْسُ مُحَمَّدٍ بِيَدِهِ أَوْ وَالَّذِي نَفْسِي بِيَدِهِ لَوْ لَمْ تُخْطِئُوا لَجَاءَ اللَّهُ عَزَّ وَجَلَّ بِقَوْمٍ يُخْطِئُونَ ثُمَّ يَسْتَغْفِرُونَ اللَّهَ فَيَغْفِرُ لَهُمْ\"',NULL,NULL),(21,'حَدَّثَنَا عُبَيْدُ اللَّهِ عَنْ زَيْدِ بْنِ أَبِي أُنَيْسَةَ عَنْ أَبِي إِسْحَقَ عَنْ جَرِيرِ بْنِ عَبْدِ اللَّهِ عَنْ النَّبِيِّ صَلَّى اللَّهُ عَلَيْهِ وَسَلَّمَ قَالَ : صِيَامُ ثَلاثَةِ أَيَّامٍ مِنْ كُلِّ شَهْرٍ صِيَامُ الدَّهْرِ وَأَيَّامُ الْبِيضِ صَبِيحَةَ ثَلاثَ عَشْرَةَ وَأَرْبَعَ عَشْرَةَ وَخَمْسَ عَشْرَةَ ',15,NULL),(22,'وعن أبي هريرة رضي الله عنه قال‏:‏ أوصاني خليلي صلى الله عليه وسلم بثلاث‏:‏ صيام ثلاثة أيام من كل شهر، وركعتي الضحى وأن أوتر قبل أن أنام',15,NULL),(24,'وعن أبي ذر قال : قال لي رسول الله صلى الله عليه وسلم : إذا صمت شيئاً من الشهر فصم ثلاث عشرة وأربع عشرة وخمس عشرة',15,NULL),(25,'وعن عبد الله بن عمرو بن العاص رضي الله عنهما قال لي رسول الله صلى الله عليه وسلم : وإن بحسبك أن تصوم كل شهر ثلاثة أيام ؛ فإن لك بكل حسنة عشر أمثالها فإن ذلك صيام الدهر كله',15,NULL);
